eval("__webpack_require__.r(__webpack_exports__);\n/* harmony default export */ __webpack_exports__[\"default\"] = ({\n  timelineEvents: [{\n    id: '285',\n    date: '1922-06-01',\n    text: 'Each bar shows the duration of drought at a single gage. The taller and darker the bar, the longer the drought event was.',\n    desktop_x_offset_per: 58,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: 'yaxis',\n    date: '1921-08-01',\n    text: 'Scroll through time',\n    desktop_x_offset_per: 22,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: 'map',\n    date: '1925-11-01',\n    text: 'The drought at this streamgage was 1,154 days long.',\n    desktop_x_offset_per: 58,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '1920s-gages',\n    date: '1927-01-01',\n    text: 'From 1920 to 1951, the data comprises 313 streamgages (see Methods).',\n    desktop_x_offset_per: 63,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: 'xaxis',\n    date: '1925-05-01',\n    text: 'Number of gages in drought',\n    desktop_x_offset_per: 55,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 275\n  }, {\n    id: '1930s',\n    date: '1932-09-01',\n    text: 'Usually known for its flooding, the worst drought during this period was on the Red River of the North in Fargo, ND, which lasted over 1,000 days.',\n    desktop_x_offset_per: 60,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '1950s-gages',\n    date: '1950-01-01',\n    text: 'From 1950 to 1980, the data comprises 1,912 streamgages (see Methods).',\n    desktop_x_offset_per: 63,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '1950s',\n    date: '1958-06-01',\n    text: 'The most severe drought in this period was near San Antonio, TX.',\n    desktop_x_offset_per: 63,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '1960s-fact',\n    date: '1968-01-01',\n    text: 'The 3 most severe droughts in this period all happened on Long Island, NY.',\n    desktop_x_offset_per: 60,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '1970s-fact',\n    date: '1975-06-01',\n    text: 'California, Iowa, and Minnesota together had 67% of the droughts in this period',\n    desktop_x_offset_per: 60,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '1980s-gages',\n    date: '1980-01-01',\n    text: 'From 1981 to 2020, the data comprises 3,198 streamgages (see Methods).',\n    desktop_x_offset_per: 63,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '1980s-fact',\n    date: '1987-07-01',\n    text: 'This drought on the Carmel River near Seaside, CA lasted almost 4 years!',\n    desktop_x_offset_per: 58,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '2000s-fact1',\n    date: '2000-06-01',\n    text: 'Over 31% of the 2,000 most severe droughts happened during this period',\n    desktop_x_offset_per: 62,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '2000s-fact2',\n    date: '2005-06-01',\n    text: 'The average duration of droughts in this period was 73 days longer than the Dust Bowl',\n    desktop_x_offset_per: 60,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }, {\n    id: '2000s',\n    date: '2009-01-01',\n    text: 'The longest drought of all was near Tampa, FL, and lasted over 6 years!',\n    desktop_x_offset_per: 62,\n    desktop_text_anchor: 'start',\n    desktop_text_width: 250\n  }]\n});\n\n//# sourceURL=webpack:///./src/assets/text/droughtAnnotations_desktop.js?");

